  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from May through July of
  1938. The report begins by summarizing the weather conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, predators,
  rodents, and reptiles- is also covered. The Refuge development and maintenance section
  discusses physical developments and plantings. Photographs are attached.\",\n\t\"license_title\":
